void genBinStrs(int n, string curr, vector<string> &res) {
    if (curr.length() == n) {
        res.push_back(curr);
        return;
    }
    genBinStrs(n, curr + "1", res);
    if (curr.empty() || curr.back() != '0') {
        genBinStrs(n, curr + "0", res);
    }
}

int main() {
    int n;
    cin >> n;
    
    vector<string> res;
    genBinStrs(n, "", res);
    
    sort(res.begin(), res.end());
    
    for (const auto &s : res) {
        cout << s << endl;
    }
    
    return 0;
}
